INSERT INTO `tp_baoming_list` VALUES (2,'avljgc1397041839','寻找O2O的魂-微生态环境下的消费行为演进--主讲：微乾隆™','公益讲座、免费','时间：2014年6月11日下午2-6点，广州',0,'http://demo.weiqianlong.com/uploads/a/avljgc1397041839/1/d/2/0/thumb_53bbad6d65226.jpg','&lt;p&gt;\r\n	&lt;span style=&quot;color:#E53333;font-size:16px;&quot;&gt;试&lt;/span&gt;\r\n&lt;/p&gt;'),(15,'bzakjv1404439028','11','11','1',0,'http://demo.weiqianlong.com/tpl/static/attachment/icon/lovely/cloud-refresh.png','1'),(4,'avljgc1397041839','寻找O2O的魂-微生态环境下的消费行为演进--主讲：微乾隆™','公益讲座、免费','时间：2014年6月11日下午2-6点，广州',0,'/uploads/3/avljgc1397041839/e/2/1/0/thumb_53b03d9150c50.jpg',''),(5,'avljgc1397041839','寻找O2O的魂-微生态环境下的消费行为演进--主讲：微乾隆™','公益讲座、免费','时间：2014年6月11日下午2-6点，广州',0,'/uploads/3/avljgc1397041839/e/2/1/0/thumb_53b03d9150c50.jpg','是的撒旦'),(6,'avljgc1397041839','寻找O2O的魂-微生态环境下的消费行为演进--主讲：微乾隆™','公益讲座、免费','时间：2014年6月11日下午2-6点，广州',0,'http://weiqianlong.com/uploads/a/avljgc1397041839/b/7/4/e/thumb_53999fd865870.jpg',''),(13,'nitbda1404287466','啦啦啦主题','20','2014年7月1日',0,'http://demo.weiqianlong.com/tpl/static/attachment/background/view/2.jpeg','介绍一下活动'),(14,'yyesjz1404194949','萨顶顶','短发','阿达',0,'阿达','&amp;nbsp;爱上是'),(8,'tzqawo1400308953','微沙龙','500','2014年6月25日',0,'http://weiqianlong.com/uploads/t/tzqawo1400308953/0/f/9/9/thumb_539a535a581c2.jpg','&lt;p style=&quot;font-family:宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;span&gt;爱情是什么？爱情里最重要的东西又是什么？在我们以为爱着的时候，常常是并不明白的。&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;span&gt;　　一个女孩爱上一个男孩，她迷恋他那种满不在乎的神情，还有纯厚又带着磁性的男低音，她觉得他与众不同。男孩也迷恋她，说她身上有着都市女孩少有的清纯。他们恋爱了。有一天，女孩病了，她给他打电话，想让他去看她，但他说，他要去一个Party，感冒不要紧，休息休息就好了。又有一次，女孩被雨堵在路上，让他去接，他说他有事走不开，让她等等，女孩在雨中等了两小时。&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;span&gt;　　后来女孩和男孩分手了，不是因为这些小事，是因为男孩又喜欢了别的女孩。女孩很伤心，但没有办法挽回男孩的爱。&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;span&gt;　　不久，女孩遇上一个比她大5岁的男人，他经常给她打电话，见了面却很寡言。他没有对女孩表白过什么，只发过一封用玫瑰图案衬底的样式漂亮的E－mail.写了一句：“我每时每刻都感受到你的呼吸。”女孩想，他爱上了自己。有一天，他又给女孩打电话，女孩说胃不舒服，要去医院。他立刻说我陪你去。女孩说不用，不严重。他没再说什么，女孩到医院的时候却发现他正等在挂号处。又有一次，女孩喝醉了，给他打电话，他放下电话，连夜开了几十公里的车去接她。他一点也没责怪她，只是说：“喝醉了多难受，以后别这样。”女孩看到他的眼里满是关切。&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;span&gt;　　可是女孩始终没有爱上这个男人，他很无奈，他说：“本来我以为我可以照顾你，现在我们只好做个朋友了，如果你需要帮助，就告诉我，我一定会来的。”女孩看着他离去，想起她的初恋男友，明白眼前这个男人才是真正爱她的。她读懂了他对她的感情里那种深切的怜惜。&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;span&gt;　　女孩在快三十岁的时候认识了一个建筑师，他们相遇的感觉好像孤独者找到了陪伴者。他们在一起时，他总是用一种专注的眼神看着她，她有不顺心的事，他就想各种方法让她高兴，他做那一切的理由只是“我想让你开心”。她有一点咳嗽，他就天天叮嘱她吃药，她出门时，他总是说你要小心。所有的事都很平凡，但所有的事都在表明他对她的怜爱。女孩也喜欢他，但不清楚自己是不是真的爱他。直到有一天，他对她讲述以前失恋的创痛，告诉她，他这些年是如何在孤独中挣扎。他把头埋在她怀里，像一个孩子。女孩抱着他，一瞬间涌上无限的怜惜，她想她一定要对他好，再不让他感到孤独。后来女孩回想那一刻，承认那是她的爱情时刻，她从没对一个男人有如此深切的怜惜，包括对她的初恋男友。&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;span&gt;　　女孩和建筑师的爱情就在相互的怜惜中日益深厚着，因为怜惜，他们彼此所做的一切都是为了让对方感到幸福和快乐；因为怜惜，他们不愿做一点点伤害对方的事。他们从怜惜里生长的爱情足以让他们觉得彼此不可或缺，他们将相互爱怜着共度一生。&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;span&gt;　　女孩经过了很多年，才弄清什么是真正可信赖的爱情，是牢固持久的爱情。从前她把迷恋当成爱情，那是很多人在犯着的一个错误。迷恋也许只是爱情的初级阶段，或者仅仅是爱的萌芽。迷恋的同时，如果不能滋生出彼此怜惜的情感，爱情就会迅速消失，因为迷恋消失的速度真的太快。&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;span&gt;　　迷恋一个人的时候，迷恋者可以做出种种令人发晕的事，包括那些海誓山盟，甜言蜜语。有一个陷在热恋中的男孩给他所爱的女孩写道：“我的爱人，即使我要穿过千山万水、赴汤蹈火，也要赶到你身边，即使天打雷劈也要和你在一起，直到世界末日。”但在情书的最后，他附了一行字：“如果星期六不下雨，我就去接你。”这个笑话一样的故事夸张地描绘出只有迷恋没有怜惜的爱情是如何浅薄和不堪一击。&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;span&gt;　　怜惜是另外一种成分的爱情。怜是爱怜，是深深的同情，惜是爱惜，是珍视，不舍得丢弃一丝一毫。怜惜是爱情之树深扎于泥土之下的茁壮的根系，没有外力的强烈破坏，它是不会轻易泯灭的。有哲学家说：“爱在本质上是一种指向弱小者的感情。”怜惜正是这样一种最本质的爱，一种完全发自内心的愿为对方的快乐与幸福付出的心态，一种不由自主地想把对方置于自己的保护之下，提供情感和身体保护的强烈的冲动，因而极尽所能地宠她(他)，心疼她(他)，不管事实上自己是否比对方更强大。怜惜不是怜悯，怜悯是一种居高临下的施舍，带着一点优越和施惠的满足，而怜惜是从尊重和欣赏出发的温柔的呵护和给予，是无条件的，无私的。&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;span&gt;　　怜惜是爱人口渴时递上的一杯水，怜惜是出门时的一句叮咛，怜惜是爱人哭泣时张开的怀抱，怜惜是匆忙回家的路上脑中闪过的“如果我不回家，她就会睡不着”的念头，怜惜是爱人病痛时恨不得替她(他)去痛的一种心情，怜惜是“只要她(他)开心，我愿意做一切”的固执，怜惜是把她(他)看做世界上最脆弱、最需要呵护的人。带着怜惜的爱情不虚饰，也不夸张，它在爱者的心中深深地驻扎着，随时准备给被爱者提供保护和温暖。&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;span&gt;　　有了怜惜的情感，就会像那个女孩和建筑师那样，不舍得做一点伤害对方的事，不愿意看到对方有一点不高兴，只想自己所爱的人能够一直感觉幸福快乐。为了这样的目标，他们就会互相取悦，互相满足对方的需求，把对方的利益置于自己之上，让对方感觉自己是爱人生命里最重要的人，将相扶相伴着走过一生。这就是建立在怜惜基础之上的最深挚、最浓厚、最牢固、最持久的爱情。&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;span&gt;　　也许我们会像那个女孩一样，要经历了很多情感的波折，要走漫长的岁月，才最终能明白，我们真正该留住的、该珍视的是什么样的爱情。但我们不一定有女孩那样的幸运，我们可能早已错过那种深藏着怜惜却被我们忽略的情感。所以，在年轻的时候，在有最多的机会遭遇感情碰撞的时候，仔细去辨别一下那些感情的成分，看看里面到底有多少属于怜惜，那应该是爱情的试金石，可以帮我们留住真爱，淘汰伪爱。&lt;/span&gt; \r\n&lt;/p&gt;'),(9,'hziflr1400551929','主题123','10000','2014.06.18',0,'http://weiqianlong.com/tpl/static/attachment/focus/default/3.jpg','阿斯打死打伤打死打伤打撒手'),(10,'hziflr1400551929','超级主题','100','2014.08.14',0,'http://weiqianlong.com/tpl/static/attachment/background/view/2.jpg','123333333333333'),(11,'txzoau1401961004','暑假报名啦','1000','2014-6-17',0,'http://weiqianlong.com/tpl/static/attachment/background/view/7.jpg','暑假报名啦'),(12,'avljgc1397041839','微乾隆','免费','2014年7月30日',0,'/uploads/3/avljgc1397041839/f/4/0/5/thumb_53b23acf99d09.png','微乾隆'),(16,'wfrtlt1404893246','报名团购瓷砖','1','2014-07-12',0,'http://demo.weiqianlong.com/uploads/w/wfrtlt1404893246/3/9/7/8/thumb_53bcfd5843553.jpg','活动内容'),(17,'tenqtn1405928888','44','44','44',0,'',''),(18,'pzjrpk1405929672','我们要','0','2014-09-06',0,'','夺标');
