46656',1,'suveod1404918522','萨芬但是防守对方得瑟',0,1),(13,3,'283497031','123','2','123',1,'首页111111','http://demo.weiqianlong.com/uploads/a/avljgc1397041839/d/d/3/e/thumb_53bdf60aaa441.jpg','1','123','{siteUrl}/index.php?g=Wap&amp;m=Repast&amp;a=index&amp;token=avljgc1397041839&amp;wecha_id={wechat_id}','1405343560','1405346128',24,'avljgc1397041839','123',0,0),(14,148,'wql','','2','',118,'商品分类','','1','的风格的师傅告诉的分公司的','','1405672387','1405672387',3,'wfrtlt1404893246','的是法国的是法国',0,0),(15,148,'wql','','2','',118,'商品分类','','1','第三方公司的分公司的风格','','1405672440','1405672440',0,'wfrtlt1404893246','上的风格上的风格十多个',0,0),(16,3,'283497031','测试图文','2','测试图文',150,'测试','http://demo.weiqianlong.com/uploads/f/fvaczq1405658789/a/e/c/b/thumb_53c8cc60074d8.png','1','','{siteUrl}/index.php?g=Wap&amp;m=Panorama&amp;a=index&amp;token=fvaczq1405658789&amp;wecha_id={wechat_id}','1405698790','1405698829',1,'fvaczq1405658789','测试图文',0,0),(17,184,'莱微生活','','2','西天目山是国家级森林和野生动物类型的自然保护区， 西天目山植被覆盖率达95%以上，森林景观独树一帜，以“古、大、高、稀、多、美”称绝于世。人称“天然植物园”的西天目山中汇集了2000多种植物。\r\n景区拥有中生代孑遗物、有“活化石”之称的野生银杏树；世界罕见的、直径达2米多的大柳杉400株，高达56米的“衡天树”金钱松，“地球独生子”天目铁木等名贵树种。它又是“鸟兽乐园”，拥有数百种鸟兽、其中有云豹、黑麂等30余种濒危动物。天目山还是昆虫世界，有昆虫26目、213科、其中以天目命名的45种。',204,'天目山景区','http://go.laivw.com/uploads/t/tenqtn1405928888/9/5/d/4/thumb_53cf143ee29c8.jpg','1','&lt;p&gt;\r\n	【门票优惠政策】\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;hr /&gt;\r\n&lt;/p&gt;\r\n1. 身高1.1米（含1.1米）以下儿童免票；身高1.2~1.5米儿童，门票半价优惠。&lt;br /&gt;\r\n2. 70周岁以上老年人凭有效证件，门票半价优惠。&lt;br /&gt;\r\n&lt;p&gt;\r\n	3. 学生凭学生证，门票半价优惠。\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n【景区内交通】\r\n&lt;hr /&gt;\r\n&lt;p&gt;\r\n	来回小交通：40.00元/&lt;span style=&quot;line-height:1.5;&quot;&gt;人&lt;/span&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;line-height:1.5;&quot;&gt;&lt;br /&gt;\r\n&lt;/span&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	开放时间：\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;hr /&gt;\r\n&lt;/p&gt;\r\n08:00~16:00&lt;br /&gt;\r\n建议游玩时间：1天&lt;br /&gt;\r\n&lt;p&gt;\r\n	电话：0571-63751978\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	景点交通攻略\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;hr /&gt;\r\n&lt;/p&gt;\r\n自驾&lt;br /&gt;\r\n1、临安到西天目山&lt;br /&gt;\r\n西天目山距离临安31公里。&lt;br /&gt;\r\n临安—杭徽高速—藻溪互通（路边有天目山广告牌）右（北）转—藻天公路（14公里）—天目山景区&lt;br /&gt;\r\n&lt;br /&gt;\r\n2、杭州到西天目山&lt;br /&gt;\r\n西天目山距杭州90公里。&lt;br /&gt;\r\n杭州—杭徽高速—临安—藻溪互通（路边有天目山广告牌）右（北）转—藻天公路（14公里）—天目山景区&lt;br /&gt;\r\n&lt;br /&gt;\r\n3、江苏到西天目山&lt;br /&gt;\r\n江苏方向—宁杭高速—德清出口下—104国道—彭公下—临安方向—经过临安—杭微高速（黄山方向）—藻溪（路边有天目山广告牌）右（北）转—藻天公路（14公里）—天目山景区&lt;br /&gt;\r\n&lt;br /&gt;\r\n4、上海到西天目山&lt;br /&gt;\r\n上海方向—沪杭高速杭州15出口下—杭州绕城高速留下互通—临安—藻溪（路边有天目山广告牌）右拐—藻天公路（14公里） —天目山景区&lt;br /&gt;\r\n&lt;br /&gt;\r\n5、安徽到西天目山&lt;br /&gt;\r\n安徽方向—杭徽高速—藻溪—出口右转—02省道直线行驶—藻天公路（14公里）—天目山景区&lt;br /&gt;\r\n&lt;br /&gt;\r\n客车&lt;br /&gt;\r\n在杭州汽车西站乘开往昌化的长途汽车，到藻溪下车，车程2小时，车资20元，再转乘到西天目山的绿色中巴，可直达景区。车程半小时，车资5元。&lt;br /&gt;','','1406080335','1406080335',4,'tenqtn1405928888','天目山风景区',0,0),(18,184,'莱微生活','','2','临安天目大峡谷旅游景区，地处浙江临安，紧邻原始森林大树王国西天目山。石谷地貌奇特，野趣浓郁，以森林、奇石、碧潭、飞瀑、火山口、冰川遗迹构成一条壮观的山野长廊。谷内千姿百态的巨石比比皆是，自天目山上直泻谷底。天然的迎客石、官帽石、青蛙石、飞来石，惟妙惟肖，呼之欲出。10吨至4000吨的巨石有5000多块。最高的官帽石30多米，面积最大的八仙台能站立100余人，最重的飞来石3987吨。著名导演谢晋游览后挥毫写下了“中华第一石谷”。',205,'天目大峡谷','http://go.laivw.com/uploads/t/tenqtn1405928888/6/e/8/4/thumb_53cf163f9ced1.jpg','1','&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;【门票优惠政策】&lt;span style=&quot;color:#666666;font-family:tahoma, arial, 宋体, sans-serif;line-height:19.1875px;white-space:normal;background-color:#F7F7F7;&quot;&gt;110.00元&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt; \r\n&lt;hr /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;1. 身高1.2米以下儿童免票；身高1.2~1.4米儿童，门票半价优惠。&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;2. 70周岁以上老年人凭有效证件，门票半价优惠。&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;开放时间：&lt;/strong&gt;&lt;/span&gt; \r\n&lt;hr /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;08:00~17:00&lt;/span&gt;&lt;br /&gt;\r\n&lt;hr /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;电话：0571-63853160&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;景点交通&lt;/strong&gt;&lt;/span&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;攻略&lt;/strong&gt;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;hr /&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;自驾&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;天目大峡谷距杭州86公里。杭州—杭徽高速—藻溪出口下高速—藻天公路（14公里）—天目大峡谷景区 （沿途有指示牌）&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;公交&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;杭州汽车西站或者庆丰春公交车站K598每天05：50-21：30每10分钟一班车。 抵达临安后，打的至西沾乘坐临安-於潜的依维柯，藻溪下，包车进景区，价格可以自己商谈。&lt;/span&gt;&lt;br /&gt;','','1406080894','1406080894',5,'tenqtn1405928888','天目大峡谷',0,0),(19,184,'莱微生活','','2','     东天目山地处浙江省西北部临安市境内，距临安市区25公里，距杭州68公里，系国家AAAA级景区。\r\n     天目山由东西两座主峰组成，两峰对峙，相距10公里，因两峰之顶各有一泓清泉，如两只眼睛仰望天空，所以叫“天目”。如今，东天目山经过开发分为东瀑大峡谷、西瀑大森林、昭明大禅院三个区块。\r\n     东天目山峡谷瀑布众多，有的高达数百米，分级而下，瀑瀑相连；有的是单级悬瀑，凌空飞泻数十米，气贯长虹；有的落差虽不高，但一股清泉飞银溅玉，秀丽妩媚。故即使炎炎夏日，这里依然凉风习习。\r\n东天目山还拥有茂密的原始森林林，古树参天，需数人合抱。原始森林中生活着数百种鸟兽，其中云豹、黒麂等30余种属珍惜濒危动物。',206,'东天目山','http://go.laivw.com/uploads/t/tenqtn1405928888/8/3/3/e/thumb_53cf187a6e0be.jpg','1','&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;【门票优惠政策】&lt;/strong&gt;140元（含景区交通费用）&lt;/span&gt;\r\n&lt;hr /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;身高1.2米以下儿童免票；身高1.2~1.4米儿童，门票半价优惠。&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;开放时间：&lt;/strong&gt;&lt;/span&gt;\r\n&lt;hr /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;夏（5月1日-10月7日）： 7:30-17:00&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;冬（10月8日-4月30日）：8:00-16:30&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;建议游玩时间：1天&lt;/span&gt;&lt;br /&gt;\r\n&lt;hr /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;电话：0571-88502158（营销中心）63968111（接待中心）&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;活动攻略&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;\r\n&lt;hr /&gt;\r\n&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;&lt;strong&gt;中国（临安）茶祖文化旅游节&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;东天目山梅家村梅氏先祖梅福，应该是中国人工栽培茶叶的第一人，可谓是中国的茶祖。《杭州市地名志》载：“相传临安天目山有梅姓来此定居，后繁衍成村落，故名梅家坞。”临安东天目山的梅家村是龙井茶栽培制作技艺的发祥地。&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;2011年中国（临安）茶祖文化旅游节在东天目山举办，节庆期间举行了茶祖梅福像奠基、茶祖文化征文大赛、踏青采茶、名茶展销、高山杜鹃节等活动。&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;时间：3月-5月&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;color:#E53333;font-size:14px;&quot;&gt;&lt;strong&gt;东天目山溯瀑挑战赛&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;“溯瀑”是种新颖时尚、颇受年轻人追捧的野外竞技活动, 逆流而进，顶瀑而上，难度极高，十分惊险，需要高超的技艺和胆识。东天目山至今已成功举办两届溯瀑挑战赛。&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;2009年 东天目山景区的东瀑脚下佳丽云集，“首届长三角都市丽人溯瀑挑战赛”在这里举行。&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;2010年 “2010年国际旅游小姐中国总决赛东天目山溯瀑赛”在东瀑举行。来自全国各地的50多位佳丽云集东天目山挑战东崖大瀑布。&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;时间：7月-10月&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;景点交通攻略&lt;/strong&gt;&lt;/span&gt;\r\n&lt;hr /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;自驾&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;【各地至杭州】&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;上海、南通、苏州方向	沪杭高速→杭州绕城&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;南京、无锡、常州方向	宁杭高速→杭州绕城&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quo