,'','1406082076','1406082076',1,'tenqtn1405928888','神龙川',0,0),(21,184,'莱微生活','','2','太湖源坐落在临安天目山南麓的太湖源镇，俗称小九寨沟。该镇因景点而获名，又因景点而扬名。\r\n\r\n太湖源为峡谷地形，景区植被覆盖率为98%，植物种类丰富，野生景观植物遍布山野，四季景色迷人。同时，景区也是一个野生动物的天堂，生活着黑麂、猕猴等多种国家重点保护动物。景区内峭壁陡崖，绿树成荫，山花烂漫，清溪长歌，悬瀑飞泻，原始自然是其主要特色。\r\n\r\n太湖源景区的文化底蕴也相当丰富。传说古人瑞彭祖曾在此隐居修炼，钱吴越王也曾踏遍龙须峰峦，指点千里江山。',208,'太湖源景区','http://go.laivw.com/uploads/t/tenqtn1405928888/2/3/8/b/thumb_53cf1d81d3f8f.jpg','1','&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;【门票优惠政策】&lt;/strong&gt;88.00元&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;\r\n&lt;hr /&gt;\r\n1. 身高1.1米以下儿童免票；身高1.1~1.4米儿童，优惠价为32.00元/人。&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;2. 70周岁以上（含70周岁）老年人凭有效证件，门票半价优惠。&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;3. 现役军人凭有效证件，门票半价优惠。&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;开放时间：&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;\r\n&lt;hr /&gt;\r\n08:00~17:00&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;建议游玩时间：3小时&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;地址：杭州临安二零五省道附近&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;电话：0571-63790368&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;景点交通攻略&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;\r\n&lt;hr /&gt;\r\n&lt;strong&gt;班车&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;1、临安新客站乘8:30、12:30的班车可达景区。&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;2、北站乘16路，首班车6:30，末班车17:10，大约每40分钟有一班中巴前往，车资6元，车程50分钟。&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;自驾&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;从临安出发，进入13省道。往湖州方向前进就会看见太湖源景区。&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;包车&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;从临安直接包出租车前往，单程30-35元，半小时可达。&lt;/span&gt;&lt;br /&gt;','','1406082519','1406082519',2,'tenqtn1405928888','太湖源景区',0,0),(22,184,'莱微生活','','2','凉源峡谷漂流景区位于临安西部重镇昌化后葛村。这里峡谷纵深，绿树成荫，河道宽阔，水质清澈，游鱼可数。目前开发的是潇洒漂，长 3000米，落差约80米，漂完约55分钟。\r\n整个过程刺激性强，有超过4米的陡降坡，1.5米的跳台潭，波浪坡，游客既能体验在浪尖上的跌宕起伏，又可体现体力与控伐的能力，也是嬉水的好地方。',264,'凉源峡谷漂流','http://go.laivw.com/uploads/t/tenqtn1405928888/0/e/a/5/thumb_53cf4e008c491.jpg','1','&lt;p&gt;\r\n	&lt;img src=&quot;/tpl/static/kindeditor/attached/image/20140723/20140723055427_18031.jpg&quot; alt=&quot;&quot; /&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span class=&quot;info-tit&quot; style=&quot;font-weight:bold;margin-bottom:5px;color:#333333;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;line-height:22.390625px;white-space:normal;background-color:#F7F7F7;&quot;&gt;地址：&lt;/span&gt;&lt;span itemprop=&quot;website&quot; class=&quot;val address-value&quot; style=&quot;color:#666666;font-family:tahoma, arial, 宋体, sans-serif;white-space:normal;background-color:#F7F7F7;&quot;&gt;浙江省临安杭州市昌化镇后葛村&lt;/span&gt;\r\n&lt;/p&gt;','','1406094879','1406094879',2,'tenqtn1405928888','凉源峡谷漂流',0,0),(23,184,'莱微生活','','2','洞天河漂流位于浙江临安市昌化地区的石瑞乡蒲村。东距杭州130公里，南邻千岛湖125公里，西离黄山166公里，北连天目山国家森林公园51公里，地处浙皖“黄金”旅游线上。 全程2.2公里，是经过隧道的激情漂流，水质清，流量大，游客可随到随漂，漂流河道四面群山，峰峦起伏，原生原态，青山飞流，风光无限，乘座皮筏艇穿越爱情隧道，能真正体会到爱与情的甜蜜，惊与险的刺激。',265,'洞天河漂流','http://go.laivw.com/uploads/t/tenqtn1405928888/2/f/9/9/thumb_53cf4ece46dee.jpg','1','&lt;p&gt;\r\n	&lt;img src=&quot;/tpl/static/kindeditor/php/../attached/image/20140723/20140723055647_51566.jpg&quot; alt=&quot;&quot; /&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span class=&quot;info-tit&quot; style=&quot;font-weight:bold;margin-bottom:5px;color:#333333;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;line-height:22.390625px;white-space:normal;background-color:#F7F7F7;&quot;&gt;地址：&lt;/span&gt;&lt;span itemprop=&quot;website&quot; class=&quot;val address-value&quot; style=&quot;color:#666666;font-family:tahoma, arial, 宋体, sans-serif;white-space:normal;background-color:#F7F7F7;&quot;&gt;浙江省杭州临安市&lt;/span&gt;\r\n&lt;/p&gt;','','1406095058','1406095058',2,'tenqtn1405928888','洞天河漂流',0,0),(24,184,'莱微生活','','2','柳溪江位于中国优秀旅游城市临安市河桥古镇，距杭州100公里，临安市区50公里，交通十分便捷，三溪汇集，始成柳溪，上游沙明水净，河滩开阔，游鱼可数游；下游江湾相连，青山对峙，风光迷人，呈浙西三峡的独特风貌。\r\n上游竹筏漂流，柳溪江竹筏漂流。在柳溪江，一次漂流却可以享受两种截然不同的快感，这就是柳溪江漂流的独特魅力所在。\r\n6公里的水路，缤纷游程，激情体验，吸引着各地游客至沓来。“小小竹排向东流，巍巍青山两岸走”，顺溪而下，如同冲浪，有惊无险。浅滩，彩石斑斓， 游鱼可数：深潭，水面如镜。两岸绿竹成荫，桑林成片、芦苇丛丛。蓝天白云青山绿竹倒影水中，妙不可言。沿途有当年太平军洗马饮马的“马渥潭”，可观赏到地球的活化 石“千年野生银杏树”，白云山的峭壁悬崖，河桥古镇的水乡特色。\r\n2004年春，经过改造的柳溪江河流段新增水帘洞天、激流冲滩、强盗劫关、龙女选婿、三乡社戏等丰富刺 激参与性活动项目。',266,'柳溪江漂流','http://go.laivw.com/uploads/t/tenqtn1405928888/0/d/9/6/thumb_53cf4f1fdc104.jpg','1','&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;ul style=&quot;margin:0px;padding:0px;list-style:none;border-top-width:1px;border-top-style:solid;border-top-color:#D3E0E6;&quot;&gt;\r\n	&lt;li style=&quot;margin:0px;padding:0px;&quot;&gt;\r\n		&lt;span style=&quot;line-height:1.5;font-size:14px;&quot;&gt;柳溪江漂流门票信息&lt;/span&gt;\r\n	&lt;/li&gt;\r\n	&lt;li style=&quot;margin:0px;padding:0px;&quot;&gt;\r\n		&lt;span style=&quot;font-size:14px;&quot;&gt;1柳溪江单程竹筏漂流展开报价￥60起&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;2柳溪江单程皮筏漂流收起报价￥58起&lt;/span&gt;\r\n	&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:14px;&quot;&gt;地址：浙江省杭州临安市柳溪江&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;电话：0571-63612128&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;/span&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;','','1406095323','1406095323',1,'tenqtn1405928888','柳溪江漂流',0,0),(25,184,'莱微生活','','2','浙西天滩风景区位于中国优秀旅游城市、国家级生态示范区临安市龙岗镇境内，地处杭州至黄山黄金旅游中部，距杭州80Km，上海260Km。天滩景区方圆20平方公里，内森林覆盖率达95%以上，负离子含量极其丰富，是不可多得的天然氧吧，景区内绿树成荫，瀑布成群，溪水清澈见底，林间鸟语花香，如诗如画。沿自然山势地貌构筑的山地民居建筑，汇集了浙西传统民居的精华，与之辉映成趣的是让游者怦然心动的吴越古风、淳朴独特的民族风情和绚丽多姿的民俗活动，聚之景区内的浙西原始山地风光、山野美食、民俗民粹，全新的生态文化主题公园得以充分体现。景区内的神话典故?华梅西餐厅',269,'浙西天滩','http://go.laivw.com/uploads/t/tenqtn1405928888/1/0/4/9/thumb_53cf506211dc8.jpg','1','&lt;p&gt;\r\n	&lt;img src=&quot;/tpl/static/kindeditor/php/../attached/image/20140723/20140723060353_92114.jpg&quot; alt=&quot;&quot; /&gt; \r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span class=&quot;info-tit&quot; style=&quot;font-weight:bold;margin-bottom:5px;color:#333333;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;line-height:22.390625px;white-space:normal;background-color:#F7F7F7;&quot;&gt;地址：&lt;/span&gt;&lt;span itemprop=&quot;website&quot; class=&quot;val address-value&quot; style=&quot;color:#666666;font-family:tahoma, arial, 宋体, sans-serif;white-space:normal;background-color:#F7F7F7;&quot;&gt;浙江省杭州临安市龙岗镇&lt;/span&gt; \r\n&lt;/p&gt;','','1406095472','1406095472',0,'tenqtn1405928888','浙西天滩风景区',0,0),(26,184,'莱微生活','','2','浙西大龙湾景区位于临安龙岗镇龙井村，森林覆盖率高达95% 的原生态峡谷景观， 属黄山余脉延伸，由天滩食街、碧湖观鱼、雄石奇瀑、峡谷探险、天滩绝景五大景区、二十八个景点及其它人文景观组成。崇山峻林、茂林修竹、奇石侧立、飞瀑如帘、千米天滩，天下罕见。近几年来，浙西大龙湾（天滩景区）被旅游界誉称为浙西山水的压轴之作，绿树成荫，瀑布成群，溪水清澈见底。横空出世的摩天巨石，深渊莫测的神秘龙潭，胜于天界瑶池的天然浴场，美妙无比的千米天滩等天然绝境，将神话美、原始美、山水美、民俗美融为一体。沿着自然山势地貌构筑的山地居民建筑，汇集了浙西传统民居的精华，与之辉映成趣的是当地的吴越古风、淳朴独特的民族风情。',268,'大龙湾风景区','http://go.laivw.com/uploads/t/tenqtn1405928888/b/1/e/c/thumb_53cf50d4de383.jpg','1','&lt;p&gt;\r\n	门票80元&lt;br /&gt;\r\n地址：浙江临安龙岗镇龙井村\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;img src=&quot;/tpl/static/kindeditor/php/../attached/image/20140723/20140723060629_36304.jpg&quot; alt=&quot;&quot; /&gt;\r\n&lt;/p&gt;\r\n&lt;img src=&quot;/tpl/static/kindeditor/php/../attached/image/20140723/20140723060629_96970.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\r\n&lt;img src=&quot;/tpl/static/kindeditor/php/../attached/image/20140723/20140723060629_14155.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;','','1406095594','1406095610',0,'tenqtn1405928888','大龙湾风景区',0,0),(27,184,'莱微生活','','2','十门峡景区位于浙皖交界处，清凉峰国家级自然保护区内，地处临安西部，景区分别由十大门景点组成，目前剑门、龙门景区已开发完善对外营业，虎门、象门景区正在开发建设度假酒店与漂流项目。十门峡综合旅游资源之丰富冠盖全国名山，“十门千峰擎日月，剑门千丈锁天地”，层峦叠嶂，周边地貌飞瀑流泉，奇景成群，百里峡谷沟壑纵横，奇峰林立，峰插云天，雄奇险峻，美轮美奂。剑门乃经典古装剧新《倩女幽魂》、《剑蝶》外景拍摄地。高达百米的“华夏第一门”拔地入云，斧劈刀削，险峻无比，神仙难攀，绝壁奇松仪态万千。虎门景区千峰直插云霄，苍山如画，群峰之势乃华夏之最；海拔之高，乃浙西群峰之巅。站在峰顶，绵延群山尽收眼底，可谓气象万千。龙门景区为华东唯一大瀑布群，18条大瀑布从千丈悬崖飞泻而下，潭瀑相连，溪涧遍布，古木成林，独一无二。三万亩原始森林神秘莫测。林木品种丰富，株高冠大，景区有古树名木千余棵，树龄一般都水上亭台在200年以上，最长达800年。其中景区独有的地质地貌景观，成为华东地区最佳的徒手攀岩基地，并拥有国际标准攀岩赛道6条。\r\n十门峡景区内奇峰天成，古木如画，群门向天，清流如歌，古有“唐昌十景”，而今更以“华东五绝”傲立群首。天然石长城气贯如虹，蜿蜒近百里。小石门削壁出世，高达百米，十九条巨瀑从海拔1300米高处奔腾直下，首尾相接垂挂于天地之间，宛如龙出升天，广达三万余亩的原始森林奇花异草争奇斗艳，野生猕猴攀枝争梢，神秘、博大、原始，密林深处石壕木堡遍布，依稀可闻古战场当年的硝烟，时至严冬，整个景区内所有飞瀑成冰，所有雪峰如柱，千里冰封雪飘，是江南罕见的“北国风光”。',267,'石门峡','http://go.laivw.com/uploads/t/tenqtn1405928888/7/a/8/6/thumb_53cf513adff85.jpg','1','&lt;p&gt;\r\n	&lt;span class=&quot;info-tit&quot; style=&quot;font-weight:bold;margin-bottom:5px;color:#333333;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;line-height:22.390625px;white-space:normal;background-color:#F7F7F7;&quot;&gt;地址：&lt;/span&gt;&lt;span itemprop=&quot;website&quot; class=&quot;val address-value&quot; style=&quot;color:#666666;font-family:tahoma, arial, 宋体, sans-serif;white-space:normal;background-color:#F7F7F7;&quot;&gt;浙江省杭州临安市马啸乡&lt;/span&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;img src=&quot;/tpl/static/kindeditor/php/../attached/image/20140723/20140723060806_90755.jpg&quot; alt=&quot;&quot; /&gt;\r\n&lt;/p&gt;\r\n&lt;img src=&quot;/tpl/static/kindeditor/php/../attached/image/20140723/20140723060806_12139.jpg&quot; width=&quot;300&quot; height=&quot;169&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;','','1406095736','1406095736',0,'tenqtn1405928888','十门峡景区',0,0),(28,184,'莱微生活','','2','老碓溪景区是浙西大峡谷最新推出的一个景点，以山水风光与人文景观(农耕文化景观)相交融为特色。它位于大峡谷嬉水滩上游的一段峡谷里，山势险峻，风景秀丽。沿着石阶渐渐步入景区,两边怪石林立，移步换景，另人目不暇接。最后是“稻草人广场”，在那里可以看到真正的老古董：油车、水碓和水磨。这里的山民世世代代居住在白云深处的山腰山巅，没电没有谷物加工厂的时候，山民便利用溪水作动力，沿溪建造起一座座水碓来舂米、磨粉、打油，老碓溪因此而得名。',270,'老碓溪','http://go.laivw.com/uploads/t/tenqtn1405928888/2/8/0/d/thumb_53cf5631811f3.jpg','1','&lt;span style=&quot;font-size:14px;&quot;&gt;门票60元&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;公交&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;市内没有直达景区的公交车，可乘坐当地出租车或包车前往景区。&lt;img src=&quot;/tpl/static/kindeditor/php/../attached/image/20140723/20140723063011_37290.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\r\n&lt;img src=&quot;/tpl/static/kindeditor/php/../attached/image/20140723/20140723063011_11277.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\r\n&lt;img src=&quot;/tpl/static/kindeditor/php/../attached/image/20140723/20140723063011_35460.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\r\n&lt;/span&gt;&lt;br /&gt;','','1406097015','1406097015',0,'tenqtn1405928888','老碓溪',0,0),(29,184,'莱微生活','','2','白水涧景区位于杭州市西郊的临安市境内，是距离沪、宁、苏、锡、杭等城市最近的生态旅游区。据《奚氏宗谱》记载：明洪武年间，白水涧的始祖曾梦游&quot;桃源&quot;，称此地为&quot;山明山秀，竹翠林烟；城山重叠，永无盗贼之虞；绿水长流，又无水旱之灾，家敦古处，户尚贞良&quot;之宝地，并在此地繁衍生息。\r\n\r\n景区拥有98%的森林覆盖率，华东地区唯一的大气本底监察测站，就设在生态区内。窖头山主峰壁立千仞，海拔1095米，有“北天目”之称。\r\n\r\n景区内飞瀑深潭，星罗棋布；十里竹海，风姿绰约。其涧之幽、水之清、竹之翠、石之奇，如梦似幻。清澈的白水溪自窖头山奔流而下，穿崖裂谷，跳石过涧，在泉坑一带形成许多瀑布深潭，峡谷激流，与“十里竹海”交相辉映。',271,'白水涧','http://go.laivw.com/uploads/t/tenqtn1405928888/7/8/9/d/thumb_53cf572c34987.jpg','1','&lt;span style=&quot;font-size:14px;&quot;&gt;【门票优惠政策】90.00元&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;\r\n&lt;hr /&gt;\r\n1. 身高1.1米以下儿童免票；身高1.1~1.4米的儿童可购儿童票，55.00元/人。&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;2. 70周岁以上老年人凭有效证件，门票半价优惠；60~69周岁老年人凭有效证件，门票八五折优惠。&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;3. 中小学生凭有效证件，门票半价优惠；大学生凭有效证件，门票八五折优惠。&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;4. 残疾人凭有效证件免票。&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;5. 军人凭有效证件，门票半价优惠。&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;6. 记者、教师凭有效证件，门票八五折优惠。&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;开放时间：&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;\r\n&lt;hr /&gt;\r\n08:00~17:00&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;建议游玩时间：半天&lt;/span&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-size:14px;&quot;&gt;地址：杭州西郊的临安市&lt;/span&gt;&lt;br /&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:14px;&quot;&gt;电话：0571-63772001&lt;/span&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;img src=&quot;/tpl/static/kindeditor/php/../attached/image/20140723/20140723063259_70834.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\r\n&lt;img src=&quot;/tpl/static/kindeditor/php/../attached/image/20140723/20140723063300_17113.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\r\n&lt;img src=&quot;/tpl/static/kindeditor/php/../attached/image/20140723/20140723063300_19036.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;/span&gt;\r\n&lt;/p&gt;','','1406097201','1406097201',0,'tenqtn1405928888','白水涧',0,0),(30,184,'莱微生活','','2','有白云人家之称的五星村位于大峡谷的中部，邻近浙西大峡谷白马崖景区。由原来的上坪村、下坪村、三垅村三个自然村合并而成，全村共有158户，域内景色优美，谷深壁陡，森林覆盖率达到90%以上，平均海拔700米，夏季平均室温26℃。农居依山而建，云藏雾绕，具有典型的江南民居特色。\r\n近年来，五星村大力发展乡村旅游业，现已有农家乐经营户20户，农家菜来自本村的高山蔬菜和山里的特色野味，已成为大都市居民休闲度假的好去处。\r\n村内有白马崖景点。浙西白马崖位于浙皖边界清凉峰国家级自然生态保护区中心地带，是“浙西大峡谷”风景区域内又一个新开发的峡谷盆景，是生态风光旅游胜地。',272,'龙岗镇五星村','http://go.laivw.com/uploads/t/tenqtn1405928888/5/d/5/4/thumb_53cf578e30c6e.jpg','1','&lt;img src=&quot;/tpl/static/kindeditor/php/../attached/image/20140723/20140723063511_34606.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;','','1406097316','1406097316',0,'tenqtn1405928888','龙岗镇五星村',0,0),(31,184,'莱微生活','','2','指南山在临安市西北、东天目山麓、太湖源头南苕溪之滨的海拔500余米的指南山上，有一个千年以上的古村，叫指南村。\r\n村中众多的千年古木在秋季到来时，变得色彩缤纷，因尚未完全开发，人迹罕至，成为资深背包客和摄影师常爱光顾的世外桃源。\r\n该村有千年的古树，树种20多种，几百棵古树环抱整个古村，有银杏、红枫、铁木、麻栗、马尾松、金钱松、向叶杨等。\r\n还有千年以上的古姓、古池、古墓、古物、古庙等。莫家庙已有1200多年历史，而700多年前的古庙遗址碑石至今还在。\r\n村中原有四只古塘，合并为一个天池，约有1000平方米湖面。该村的古墓中，还曾出土过5000多年前和3000多年前的青铜器钱币。',273,'指南村','http://go.laivw.com/uploads/t/tenqtn1405928888/d/8/b/7/thumb_53cf57e8e7a9d.jpg','1','&lt;p&gt;\r\n	&lt;span class=&quot;info-tit&quot; style=&quot;font-weight:bold;margin-bottom:5px;color:#333333;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;line-height:22.390625px;white-space:normal;background-color:#F7F7F7;&quot;&gt;临安市北站公交&lt;/span&gt;&lt;span itemprop=&quot;website&quot; class=&quot;val address-value&quot; style=&quot;color:#666666;font-family:tahoma, arial, 宋体, sans-serif;white-space:normal;background-color:#F7F7F7;&quot;&gt;16路&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span itemprop=&quot;website&quot; class=&quot;val address-value&quot; style=&quot;color:#666666;font-family:tahoma, arial, 宋体, sans-serif;white-space:normal;background-color:#F7F7F7;&quot;&gt;&lt;img src=&quot;/tpl/static/kindeditor/php/../attached/image/20140723/20140723063724_98363.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\r\n&lt;img src=&quot;/tpl/static/kindeditor/php/../attached/image/20140723/20140723063725_81287.jpg&quot; width=&quot;300&quot; height=&quot;204&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;/span&gt; \r\n&lt;/p&gt;','','1406097480','1406097480',0,'tenqtn1405928888','指南山',0,0),(32,184,'莱微生活','','2','临安出租车7元/公里，公交1.5（市区）2-11元（外围）',221,'临安公交线','','1','&lt;p class=&quot;p0&quot; style=&quot;margin-bottom:0pt;margin-top:0pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;1&lt;/strong&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;font-size:14px;&quot;&gt;&lt;strong&gt;号线路&lt;/strong&gt;&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;\r\n&lt;/p&gt;\r\n&lt;p class=&quot;p0&quot; style=&quot;margin-bottom:0pt;margin-top:0pt;&quot;&gt;\r\n	&lt;span style=&quot;font-size:14px;&quot;&gt; &lt;/span&gt;\r\n&lt;/p&gt;\r\n&lt;hr /&gt;\r\n【市区路线】&lt;o:p&gt;&lt;/o:p&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;p class=&quot;p0&quot; style=&quot;margin-bottom:0pt;margin-top:0pt;&quot;