INSERT INTO `tp_lvyou` VALUES (1,'avljgc1397041839','旅游','旅游','http://weiqianlong.com/uploads/a/avljgc1397041839/e/e/7/f/thumb_539e4d6203232.jpg','123','http://weiqianlong.com/uploads/a/avljgc1397041839/f/f/6/9/thumb_539c71e223259.jpg','http://weiqianlong.com/uploads/a/avljgc1397041839/e/e/7/f/thumb_539e4d6203232.jpg','123','35.7679036399','115.04180306515','123','123','123'),(2,'tenqtn1405928888','临安旅游','临安','http://go.laivw.com/uploads/t/tenqtn1405928888/0/3/d/7/thumb_53ce931e2af99.jpg','','http://go.laivw.com/uploads/t/tenqtn1405928888/5/a/2/d/thumb_53ce88f3c6b85.jpg','http://go.laivw.com/uploads/t/tenqtn1405928888/a/c/8/3/thumb_53ce88fd8c271.jpg','浙江杭州临安市','30.227658','119.70904','&lt;p&gt;	&lt;span style=&quot;color:#333333;text-transform:none;text-indent:0px;letter-spacing:normal;font-family:arial;font-size:18px;font-style:normal;font-variant:normal;font-weight:bold;word-spacing:0px;white-space:normal;background-color:#F6F6F6;-webkit-text-stroke-width:0px;&quot; class=&quot;view-head-scene-enname&quot;&gt;Linan&lt;/span&gt;&lt;span style=&quot;font:14px/21px tahoma, arial, 宋体, sans-serif;color:#AAAAAA;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;font-size-adjust:none;font-stretch:normal;background-color:#F6F6F6;-webkit-text-stroke-width:0px;&quot; class=&quot;view-head-gray-font&quot;&gt;|&lt;/span&gt;&lt;span style=&quot;font:14px/21px tahoma, arial, 宋体, sans-serif;color:#333333;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;font-size-adjust:none;font-stretch:normal;background-color:#F6F6F6;-webkit-text-stroke-width:0px;&quot; class=&quot;view-head-scene-abstract&quot;&gt;临安曾是南宋首府所在，有“临时安顿”之意。走过历史的喧嚣，现在临安逐渐成为以旅游为重头的城市，奇山秀水，峻石险峰，这里丰富的旅游资源让无数游客流连。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;	&lt;span style=&quot;font:14px/21px tahoma, arial, 宋体, sans-serif;color:#333333;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;font-size-adjust:none;font-stretch:normal;background-color:#F6F6F6;-webkit-text-stroke-width:0px;&quot; class=&quot;view-head-scene-abstract&quot;&gt;&lt;/span&gt;&lt;span style=&quot;font:14px/21px tahoma, arial, 宋体, sans-serif;color:#333333;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;font-size-adjust:none;font-stretch:normal;background-color:#F6F6F6;-webkit-text-stroke-width:0px;&quot; class=&quot;view-head-scene-abstract&quot;&gt;艺术&lt;/span&gt;&lt;/p&gt;','&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 生态旅游景点呈现出独特的魅力，现已开发建成的有：天目山、青山湖、钱王陵、玲珑山、太湖源、浙西大峡谷、白水涧、天目石谷、瑞晶洞、西径山、大明山、石长城、柳溪江、浙西天池、神龙川、东天目、天潭公园等十七个景点。临安的真山、真水、真空气、真情吸引了众多的国内外游客。2001年度接待了游客200万人次，2002年则达到235万，显示出临安旅游的蓬勃生机，且接待量仍保持快速增长势头。&lt;p style=&quot;font:12px/18px tahoma, arial, 宋体, sans-serif;margin:0px 0px 10px;padding:0px;color:#333333;text-transform:none;text-indent:2em;letter-spacing:normal;word-spacing:0px;white-space:normal;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;&quot; class=&quot;text-p text-desc-p&quot;&gt;	&amp;nbsp;&lt;/p&gt;','&lt;span style=&quot;font:14px/24px arial, 宋体, sans-serif;color:#333333;text-transform:none;text-indent:28px;letter-spacing:normal;word-spacing:0px;float:none;display:inline !important;white-space:normal;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 临安市位于东经118°51&apos;至119°52&apos;，北纬29°56&apos;至30°23&apos;，临安市总面积3126.8平方千米，是&lt;/span&gt;浙江省&lt;span style=&quot;font:14px/24px arial, 宋体, sans-serif;color:#333333;text-transform:none;text-indent:28px;letter-spacing:normal;word-spacing:0px;float:none;display:inline !important;white-space:normal;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;&quot;&gt;陆地面积最大的&lt;/span&gt;县级市&lt;span style=&quot;font:14px/24px arial, 宋体, sans-serif;color:#333333;text-transform:none;text-indent:28px;letter-spacing:normal;word-spacing:0px;float:none;display:inline !important;white-space:normal;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;&quot;&gt;。地处&lt;/span&gt;浙江省&lt;span style=&quot;font:14px/24px arial, 宋体, sans-serif;color:#333333;text-transform:none;text-indent:28px;letter-spacing:normal;word-spacing:0px;float:none;display:inline !important;white-space:normal;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;&quot;&gt;西北部天目山区，东邻&lt;/span&gt;杭州&lt;span style=&quot;font:14px/24px arial, 宋体, sans-serif;color:#333333;text-transform:none;text-indent:28px;letter-spacing:normal;word-spacing:0px;float:none;display:inline !important;white-space:normal;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;&quot;&gt;市&lt;/span&gt;余杭区'),(3,'tenqtn1405928888','杭州旅游','天目山','http://go.laivw.com/uploads/t/tenqtn1405928888/d/8/3/3/thumb_53ce8a581a714.jpg','景区风光','http://go.laivw.com/uploads/t/tenqtn1405928888/9/4/5/b/thumb_53ce8a8fd5a56.jpg','http://go.laivw.com/uploads/t/tenqtn1405928888/4/2/8/8/thumb_53ce8a9b81c9e.jpg','浙江杭州市','30.259244','120.219375','&lt;div style=&quot;font:14px/24px arial, 宋体, sans-serif;margin:15px 0px 5px;color:#333333;text-transform:none;text-indent:2em;letter-spacing:normal;word-spacing:0px;white-space:normal;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;&quot; class=&quot;para&quot;&gt;	杭州，简称杭，浙江省省会、副省级市，长三角副中心城市、华东地区中心城市之一，是浙江省的政治、经济、文化、科教、交通、传媒、通信和金融中心，华东地区重要的经济、科教、文化、金融中心及交通、通信枢纽，是中国首座高铁十字架城市，杭州都市经济圈核心城市。&lt;/div&gt;&lt;div style=&quot;font:14px/24px arial, 宋体, sans-serif;margin:15px 0px 5px;color:#333333;text-transform:none;text-indent:2em;letter-spacing:normal;word-spacing:0px;white-space:normal;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;&quot; class=&quot;para&quot;&gt;	杭州是中国七大古都，首批国家历史文化名城和全国重点风景旅游城市，距今5000年前的余杭良渚文化被誉为“文明的曙光”，自秦设县以来，已有2200多年的建城史，五代吴越国和南宋在此定都，元朝时曾被意大利旅行家马可·波罗赞为“世界上最美丽华贵之城。&lt;/div&gt;&lt;div style=&quot;font:14px/24px arial, 宋体, sans-serif;margin:15px 0px 5px;color:#333333;text-transform:none;text-indent:2em;letter-spacing:normal;word-spacing:0px;white-space:normal;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;&quot; class=&quot;para&quot;&gt;	杭州位于中国东南沿海、浙江省北部、钱塘江下游北岸、京杭大运河南端，是公安部授权的口岸签证城市，国家旅游局确定的中国最佳旅游目的地城市，自古有“人间天堂”的美誉。&lt;/div&gt;&lt;div style=&quot;font:14px/24px arial, 宋体, sans-serif;margin:15px 0px 5px;color:#333333;text-transform:none;text-indent:2em;letter-spacing:normal;word-spacing:0px;white-space:normal;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;&quot; class=&quot;para&quot;&gt;	杭州是世界休闲博览会、中国国际动漫节和中国国际微电影展的终身举办城市，是中国主要的会展城市之一，如今杭州正在以“城市东扩、旅游西进，沿江开发、跨江发展”为总体发展目标，由“西湖时代”向“钱塘江时代”大步迈进。&lt;span style=&quot;display:none;&quot; id=&quot;__kindeditor_bookmark_end_9__&quot;&gt;&lt;/span&gt;&lt;/div&gt;&lt;p style=&quot;font:12px/18px tahoma, arial, 宋体, sans-serif;margin:0px 0px 10px;padding:0px;color:#333333;text-transform:none;text-indent:2em;letter-spacin','&lt;div style=&quot;font:14px/24px arial, 宋体, sans-serif;margin:15px 0px 5px;color:#333333;text-transform:none;text-indent:2em;letter-spacing:normal;word-spacing:0px;white-space:normal;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;&quot; class=&quot;para&quot;&gt;	杭州拥有两个国家级风景名胜区——西湖风景名胜区、“两江两湖”（富春江——新安江——千岛湖——湘湖）风景名胜区；两个国家级自然保护区——天目山、清凉峰自然保护区；七个国家森林公园——千岛湖、大奇山、午潮山、富春江、青山湖、半山和桐庐瑶琳森林公园；一个国家级旅游度假区——之江国家旅游度假区；全国首个国家级湿地_西溪国家湿地公园。杭州还有全国重点文物保护单位25个、国家级博物馆9个。全市拥有年接待1万人次以上的各类旅游景区、景点120余处。&lt;/div&gt;&lt;div style=&quot;font:14px/24px arial, 宋体, sans-serif;margin:15px 0px 5px;color:#333333;text-transform:none;text-indent:2em;letter-spacing:normal;word-spacing:0px;white-space:normal;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;&quot; class=&quot;para&quot;&gt;	著名的旅游胜地有瑶琳仙境、桐君山、雷峰塔、岳庙、三潭映月、苏堤、六和塔、宋城、南宋御街、灵隐寺、跨湖桥遗址等。2011年6月24日，杭州西湖正式列入《世界遗产名录》。&lt;/div&gt;&lt;div style=&quot;font:14px/24px arial, 宋体, sans-serif;margin:15px 0px 5px;color:#333333;text-transform:none;text-indent:2em;letter-spacing:normal;word-spacing:0px;white-space:normal;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;&quot; class=&quot;para&quot;&gt;	2012年接待入境旅游者331.12万人次，比上年增长8.1%；接待国内游客8236.88万人次，增长14.7%。旅游总收入达到1392.25亿元，增长16.9%，其中旅游外汇收入22.02亿美元，增长12.5%。市民出境旅游93.09万人次，比上年增长24.8%。旅游基础设施日趋完善。至年末，全市各类旅行社达606家，比上年增长7.8%；星级宾馆达到217家，其中五星级酒店20家，四星级酒店43家；A级景区40个，其中5A景点3个，4A景点26个。&lt;/div&gt;&lt;div style=&quot;font:14px/24px arial, 宋体, sans-serif;margin:15px 0px 5px;color:#333333;text-transform:none;text-indent:2em;letter-spacing:normal;word-spacing:0px;white-space:normal;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;&quot; class=&quot;para&quot;&gt;	继西湖申遗成功后，2014年6月22日，中国大运河成功入选世界文化遗产名录。它为杭州这座古老城市又添上了一抹浓墨重彩的文化气息&lt;/div&gt;&lt;p&gt;	&amp;nbsp;&lt;/p&gt;','&lt;p style=&quot;font:bold 12px/24px tahoma, arial, 宋体, sans-serif;margin:0px;padding:0px;color:#333333;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;&quot; class=&quot;item-name&quot;&gt;	&amp;nbsp;&lt;/p&gt;');
/*!40000 ALTER TABLE `tp_lvyou` ENABLE KEYS */;
UNLOCK TABLES;

