INSERT INTO `tp_member_card_exchange` VALUES (1,5,'pvosmg1397034660',5,0,1,'欢迎到本店使用电子会员卡','每天签到奖励5分，消费50元奖励1分。',1397132985),(2,6,'avljgc1397041839',127,0,127,'11','11',1399470345),(3,13,'nepvyy1400393099',1,0,2,'发礼品了哦','发礼品了哦',1400636848),(4,16,'wsupsl1400754187',1,0,2,'2222','1212',1400754568),(5,15,'avljgc1397041839',127,0,127,'10101','101',1401157462),(6,14,'tzqawo1400308953',2,0,10,'1','1',1401365445),(7,22,'rbxjud1402368974',1,0,1,'&lt;span style=&quot;color:#666666;font-family:微软雅黑;background-color:#FCFCFC;&quot;&gt;会员卡使用说明&lt;/span&gt;','&lt;span style=&quot;color:#666666;font-family:微软雅黑;background-color:#FCFCFC;&quot;&gt;积分规则说明&lt;/span&gt;',1402396361),(8,2,'rprdef1402652925',1,0,1,'&lt;p&gt;\r\n	&lt;span style=&quot;font-size:14px;&quot;&gt;1、请在结账前出示此卡；&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:14px;&quot;&gt;&amp;nbsp;2、此卡可享受会员优惠待遇；&amp;nbsp;&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:14px;&quot;&gt;3、此卡不得购买产品，不得与其它优惠同时使用；&lt;/span&gt; \r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span style=&quot;font-size:14px;&quot;&gt;&amp;nbsp;4、本店保留此卡法律范围内的最终解释权。&lt;/span&gt; \r\n&lt;/p&gt;','&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;ol&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;line-height:1.5;font-size:14px;&quot;&gt;会员每日签到可获得2个积分&lt;/span&gt; \r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;line-height:1.5;font-size:14px;&quot;&gt;会员在店内消费满1元获得1个积分&lt;/span&gt; \r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;line-height:1.5;font-size:14px;&quot;&gt;酒店将定期推出积分兑换活动&lt;/span&gt; \r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;line-height:1.5;font-size:14px;&quot;&gt;积分兑换需本人持本人身份证兑换。&lt;/span&gt; \r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;line-height:1.5;font-size:14px;&quot;&gt;每次兑换积分后冲减兑换的积分额。&lt;/span&gt; \r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;line-height:1.5;font-size:14px;&quot;&gt;1000积分可抵20元现金券使用，不能兑换现金，积分可以自由选择店内所有商品。&lt;/span&gt; \r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;line-height:1.5;font-size:14px;&quot;&gt;每张积分卡兑换期限为2年，预期不兑换者所有积分清零。&lt;/span&gt; \r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;line-height:1.5;font-size:14px;&quot;&gt;会员购物积分后，如需办理退换货，须凭VIP会员卡、购物凭证等办理退换货及增减积分手续。&lt;/span&gt; \r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n		&lt;span style=&quot;font-size:14px;line-height:1.5;&quot;&gt;积分卡最终解释权归老乡镇酒店&lt;/span&gt; \r\n	&lt;/li&gt;\r\n&lt;/ol&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;',1402713177),(9,5,'hziflr1400551929',1,0,1,'123213','213123',1402849531),(10,2,'yyesjz1404194949',5,0,10,'6555','565',1404909627),(11,11,'tenqtn1405928888',2,0,0,'&lt;p&gt;\r\n	1、仅限指定加盟商家使用；\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	2、本卡不挂失，积分不兑现；\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	3、莱微生活拥有本会员卡最终解释权。\r\n&lt;/p&gt;','&lt;p&gt;\r\n	积分用途：\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	1、积分可兑换礼品；\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	2、可兑换加盟商家消费使用；\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	积分获得：\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	领取专属福利会员卡1、每日签到2分；2、商家消费活动；3、微信抽奖活动；等等\r\n&lt;/p&gt;',1406535106);
